const initialState = {
    name : "kim",
    age : 28,
    password : "1234",
};

const changeNickname =(data) => {
    return{
        type : "CHANGE_NICKNAME",
        data,
    }
};

const rootReducer = ((state = initialState, action) =>{
    switch(action.type){
        case "CHANGE_NICKNAME":
            return{
                ...state,
                name : action.data,
            }
    }
});

export default rootReducer;
